import React from "react";
import Nav from '../components/navbar';
import Foot from '../components/footer';

function Contact() {
  return (
    <div id="wrapper">
      <Nav />
      <div id="banner">
        <img src="/background_phone.jpg" />
        <h4>Get in Touch</h4>
      </div>
      <div id="contactwrapper">

      </div>
      <h2 >Contact US</h2>
      <Foot />
      <style jsx>{`
        body {
          margin: 0;
        }
        #banner {
          float: left;
          width: 100%;
          height: 350px;
          overflow: hidden;
          position: relative;
        }
        #banner img {
          float: left;
          width: 100%;
          height: auto;
          margin-top: -100px;
        }
        #banner h4 {
          position: absolute;
          margin: auto;
        }
        #wrapper {
          float: left;
          margin: 0;
          width: 100%;
        }
        h2 {
          float: left;
          display: block;
        }
        `}</style>
    </div>

  );
}

export default Contact;
